import React, { useEffect, useState } from 'react';
import { Grid, Button } from '@mui/material';
import '../part-timer-style.scss'
import { EmployeeTabData } from '../../../sevices/account'
import _ from 'lodash';
import Loader from '../../Loader';
function PositionFilledTab() {
    const [filledTab, setFilledTab] = React.useState([]);
    const [meta, setMeta] = React.useState({});
    const [loading, setLoading] = useState(false);
    useEffect(() => {
        AppliedData();

    }, []);
    const AppliedData = async () => {
        let requestParams = { status: [6] };
        setLoading(true)
        try {
            const response = await EmployeeTabData(requestParams);
            if (response?.status === 200) {
                setFilledTab(response?.data?.items)
                setMeta(response?.data)
            }
            setLoading(false)

        } catch (err) {
            setLoading(false)
            console.log("ERRR", err)
        }
    };

    return (
        <div className="myJobsTabPanel positionFilled">
            <Grid container spacing={5}>
                <Grid item xs={12} sm={12} lg={8}>
                    {
                        filledTab?.length === 0 ? <div className="myJobsCard filledJobCard"><div className="jobNodata">
                            <span>
                                No Data
                            </span>
                        </div></div> :
                            filledTab.map(ele => {

                                return (
                                    <div className="myJobsCard filledJobCard">
                                        <div className="cardInfoContainer">
                                            {ele?.employer_profile?.company_logo ?
                                                <img src={`${meta?.meta?.company_logo?.path}/${meta?.meta?.company_logo?.folder}/${meta?.meta?.company_logo?.sizes?.medium}/${ele?.employer_profile?.company_logo}`} className="cardLogo" />
                                                : <img src={require("../../../assets/images/default-logo1.png")} className="cardLogo" />}
                                            <div className="cardInfoRight">
                                                <div className="cardInfoHeader">
                                                    <div className="name">
                                                        <span>{ele?.employer_profile?.company_name}</span>
                                                        <span className="info">{ele?.job_post?.title}</span>
                                                    </div>
                                                    <div className="headerRight">
                                                        <Button className="rejectBtn">Rejected</Button>
                                                    </div>
                                                </div>
                                            </div>
                                        </div>

                                    </div>

                                )
                            })}

                </Grid>
                <Grid item xs={12} sm={6} lg={4}>
                    <div className="registrationRightCard">
                        <div className="registrationRightImg">
                            <img src={require('../../../assets/images/registration-vector.jpg')} alt="" />
                        </div>
                        <div className="subscriptionCardCheckListContainer">
                            <div className="subscriptionCardCheckListSet">
                                <img src={require('../../../assets/images/check-icon.png')} alt="" />
                                <span>
                                    Build your profile and so recruiters find you
                                </span>
                            </div>
                            <div className="subscriptionCardCheckListSet">
                                <img src={require('../../../assets/images/check-icon.png')} alt="" />
                                <span>
                                    Safe and secure payment guarantee
                                </span>
                            </div>
                            <div className="subscriptionCardCheckListSet">
                                <img src={require('../../../assets/images/check-icon.png')} alt="" />
                                <span>
                                    Get job details through your email id.
                                </span>
                            </div>
                            <div className="subscriptionCardCheckListSet">
                                <img src={require('../../../assets/images/check-icon.png')} alt="" />
                                <span>
                                    Find a right part time job and grow your career
                                </span>
                            </div>
                        </div>
                    </div>
                </Grid>
            </Grid>
            <Loader loading={loading} />
        </div>
    )
}
export default PositionFilledTab;
